import { BarChart } from "@mui/x-charts/BarChart";

export default function RawGraph() {
  return (
    <>
      <BarChart
      width = {500}
      height = {500}
        xAxis={[
          {
            label: "Income Groups (in thousands of USD)",
            scaleType: "band",
            data: ["White" , "Black"]
          },
        ]}

        series={[
          {
            label: "White",
            data: [
              15.44
            ],
            color: "#BCD9FF",
          },
          {
            label: "Black",
            data: [
              25.18
            ],
            color: "#2a3439",
          },
        ]}
        s
      />
    </>
  );
}
